"72509":{"id":"72509","name":"Tsuredure Children","slug":"tsuredure-children","original_title":"徒然チルドレン","overview":"Uma série retratando vários cenários de jovens amores. As histórias vão de um garoto, que afetado por sua falta de confiança em si mesmo, não consegue nem aceitar que a garota de seus sonhos o convidou para sair, até uma garota quase insana, que coloca seu próprio sangue em chocolates caseiros para ganhar o coração dele.","first_air_date":"2017-07-04","episode_run_time":12,"vote_average":8.1,"number_of_seasons":1,"number_of_episodes":12,"created_by":[],"production_companies":["NAS","Jinnan Studio","Studio Gokumi","King Records","A-1 Pictures"],"genres":["Animação","Comédia","Drama"],"certification":"14","backdrop_path":"https://image.tmdb.org/t/p/original/tGOAr8TBOcUIMVZQqJiZgzB3iz6.jpg","poster_path":"https://image.tmdb.org/t/p/original/7cCFzTvhpU27G2hK1aIFQ6DLVlJ.jpg","cast":[],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/Aa2VeVrvcg59pMubH6VgmcuKFtt.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/Aa2VeVrvcg59pMubH6VgmcuKFtt.jpg","air_date":"2017-07-04","episode_count":12,"overview":"Pra vocês que nunca conseguiram dizer um \"eu te amo\" - esta é uma história de estudantes comuns de colegial, e como o amor os deixa motivados, chocados, magoados, risonhos e chorosos. Mesmo quando nem tudo dá certo, esta história de adolescência e romance vai lhe mostrar como eles aproveitam seus dias dourados. Aqui, cada personagem é um protagonista, e você vai encontrar alguém com quem se identificar.","vote_average":9,"episodes":{"1":{"name":"Confissão","overview":"A garota que Takase está afim o chama para conversar. Minagawa se confessa para Furuya-kun, que fica sem reação. Akagi pega Kaji fumando e faz um acordo. Saasahara pretende se confessar, mas falta um pouco de coragem","air_date":"2017-07-04","runtime":12,"still_path":"https://image.tmdb.org/t/p/original/2EwcDd6sRjgDkrwi98eSgXpIkRS.jpg","vote_average":9},"2":{"name":"Primavera","overview":"A irmã de Furuya não quer que ele namore com Minagawa. Sasahara tenta recrutar Kaga para o clube, mas parece que outra coisa o interessa . Kagume quer se confessar para Goda, mas acontece um mal entendido. Sugawara divide seu guarda-chuva com Takano, que entende tudo errado. menos","air_date":"2017-07-11","runtime":12,"still_path":"https://image.tmdb.org/t/p/original/ucSo8QCOG9RT3y4sshZiKkkvE5C.jpg","vote_average":9},"3":{"name":"Relacionamentos de Curta Distância","overview":"Chiaki e Kana estão namorando há um ano, mas não parece que estão. Matsuura é rejeitada e seu senpai tenta animá-la. Kurihara chama Yamane para sair, que fica incrédulo. Sugawara se oferece para ajudar Takano, e aproveita para se declarar, mas ela entende tudo errado. menos","air_date":"2017-07-18","runtime":12,"still_path":"https://image.tmdb.org/t/p/original/j00z5VMTAvF4xcmnpNzCOY1AihZ.jpg","vote_average":9},"4":{"name":"Comédia Romântica","overview":"Kana e Chiaki querem evoluir seu relacionamento, mas algumas interrupções acontecem. Kaji chama Akagi para explicar que não quer sair com ele, mas acaba caindo em seus encantos. Minagawa quer a resposta de Furuya. Takano entrega uma carta de amor de sua amiga para Sugawara, será que ele fará sua declaração?","air_date":"2017-07-25","runtime":12,"still_path":"https://image.tmdb.org/t/p/original/96QqqxwjfSglpMgt1AjZ80AWyrg.jpg","vote_average":9},"5":{"name":"Vendo Você de Longe","overview":"Takase e Kanda estão conversando por mensagem, e acontece um mal entendido. Kaga chama sua amiga de infância, Nanase, para o clube. Goda parece estar distante e frio com Kamine.","air_date":"2017-08-01","runtime":12,"still_path":"https://image.tmdb.org/t/p/original/8WsLTfKk2UlcROllANg2OiC0TfM.jpg","vote_average":9},"6":{"name":"Não Precisamos de Garotas","overview":"Akagi explica o que sente por Kiji. Chiaki e Kana estão evitando falar sobre aquele assunto. Yamane tem em encontro, mas seu amigo parece não gostar. E, Katori faz uma fã.","air_date":"2017-08-08","runtime":12,"still_path":"https://image.tmdb.org/t/p/original/1mC5awVsdFdmbvZG59VmVotmfUt.jpg","vote_average":9},"7":{"name":"É Tudo Culpa da Febre","overview":"Hotaru tenta atrapalhar seu irmão, mas Minagawa percebe. Goda e Kamine resolvem algumas questões do namoro. Takase quer falar com Kanda, e pede conselhos para o Senpai. Takano acha que está com febre e encontra com Sugawara na enfermaria.","air_date":"2017-08-15","runtime":12,"still_path":"https://image.tmdb.org/t/p/original/2GIbUE3HcdGEWdFpvQx6smiaXYq.jpg","vote_average":9},"8":{"name":"Anjo Ferido","overview":"Kazuko encontra Senichi caído, todo ferido, atrás da escola. Ela tenta ajuda-lo, mas Senichi recusa, dizendo que a culpa para estar naquele estado era somente dele, por fazer outras garotas se apaixonarem, involuntárias à sua vontade. Apesar disso, Kazuko insiste, mas suas investidas são evitadas por movimentos majestosos de Senichi...","air_date":"2017-08-22","runtime":12,"still_path":"https://image.tmdb.org/t/p/original/xNMPVcOsSYnhM8HOepM0dcSngLI.jpg","vote_average":9},"9":{"name":"Um Quadrado","overview":"Takurō e Chizuru se entreolham repetidamente durante a aula de natação. Haruhiko e Saki tratam de sua recente falha de comunicação e decidem se tornar amigos novamente, embora cada um ainda nutra sentimentos pelo outro. Ayaka espera que Takeru a beije novamente devido à tosse dela durante o primeiro beijo; mas Takeru está hesitante, pensando que o primeiro beijo foi muito ousado. Jun decidiu sair com Yuki, mas fica frustrado quando ela tem problemas para falar sério com ele.","air_date":"2017-08-29","runtime":12,"still_path":"https://image.tmdb.org/t/p/original/dBTy3MEeUJonO9DJxqtFc4cRais.jpg","vote_average":9},"10":{"name":"Amantes","overview":"Chiyo encontra Takao atrás da escola para dar-lhe pudim caseiro, e ele traz Tomomichi para se apoiar. Ayaka fica com ciúmes ao ver Takeru com outras garotas; e Chiaki e Kana depois veem as duas sendo abertamente românticas no parque, notando o quanto as duas mudaram. Chiaki convida Kana para ir a sua casa na tentativa de finalmente beijá-la, mas ela fica brava e rompe o relacionamento quando ele a beija depois de fingir estar bêbado.","air_date":"2017-09-05","runtime":12,"still_path":"https://image.tmdb.org/t/p/original/1YM6gYwZnILbK0ffX4Hh4nKzltN.jpg","vote_average":9},"11":{"name":"Sintonização","overview":"O amigo da banda de Takano tenta fazer com que ela confesse sobre sua paixão. Kana e Chiaki tentam consertar as coisas, mas a tecnologia os separa ainda mais. Mamãe para o resgate! Os exames são uma droga, mas Kaji está inspirado e determinado a ir para a faculdade.","air_date":"2017-09-12","runtime":12,"still_path":"https://image.tmdb.org/t/p/original/gPFLgcXc3cDVHJHUXm5HE67IkKc.jpg","vote_average":9},"12":{"name":"O verão começa","overview":"É dia de esportes, e os meninos (e Patricia) estão ansiosos para mostrar às meninas o que eles têm. As férias de verão estão prestes a começar e Kanda e Takase tentam convencer um ao outro a ir para a viagem da classe à praia. Chiaki se encontra com Kana para encerrar o relacionamento.","air_date":"2017-09-19","runtime":12,"still_path":"https://image.tmdb.org/t/p/original/8gBq8RIJUUDsaozagd6FOeBuq8n.jpg","vote_average":9}}}}},
